import React, { useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Link } from "react-router-dom";
import "./CustHeader.css";  

export default function CustHeader() {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <div className="custom-container">
      <header className="custom-header">
        <div className="custom-navbar-container">
          <nav className="custom-navbar navbar-expand-lg">
            <div className="container-fluid custom-container-fluid">
              <Link className="custom-navbar-brand" to="/custheader/dashboard">
                <span className="custom-brand-icon">🌍</span>
                <span className="custom-brand-name">Agri Waste</span>
              </Link>
              <button
                className="custom-navbar-toggler"
                type="button"
                onClick={() => setIsOpen(!isOpen)}
                aria-controls="navbarSupportedContent"
                aria-expanded={isOpen ? "true" : "false"}
                aria-label="Toggle navigation"
              >
                <span className="custom-toggler-icon"></span>
              </button>
              <div className={`custom-navbar-collapse ${isOpen ? "show" : ""}`} id="navbarSupportedContent">
                <ul className="custom-nav-list">
                  <li className="custom-nav-item">
                    <Link className="custom-nav-link" to="/custheader/sellwaste">
                      Sell Waste
                    </Link>
                  </li>
                  <li className="custom-nav-item">
                    <Link className="custom-nav-link" to="/custheader/history">
                      History
                    </Link>
                  </li>
                  <li className="custom-nav-item">
                    <Link className="custom-nav-link" to="/custheader/dashboard">
                      Dashboard
                    </Link>
                  </li>
                </ul>
              </div>
            </div>
          </nav>
        </div>
      </header>
    </div>
  );
}
